import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '@landinghub/api';
import GrapesJS from 'grapesjs';
import 'grapesjs/dist/css/grapes.min.css';
import 'grapesjs-preset-webpage';
import '../styles/CreateLanding.css';

const CreateLanding = () => {
    const [description, setDescription] = useState('');
    const [aiGeneratedContent, setAiGeneratedContent] = useState('');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const editorRef = useRef(null);
    const navigate = useNavigate();

    const handleGenerateAI = async () => {
        if (!description) {
            setError('Vui lòng nhập mô tả');
            return;
        }
        try {
            setLoading(true);
            const response = await api.post('/api/pages', { description });
            const fullHtml = response.data.html; // Backend trả về HTML kết hợp CSS/JS
            setAiGeneratedContent(fullHtml);
            if (editorRef.current) {
                editorRef.current.setComponents(fullHtml);
                editorRef.current.setStyle(''); // CSS đã được nhúng trong HTML
            }
        } catch (err) {
            setError('Lỗi khi tạo content từ AI: ' + (err.response?.data?.error || err.message));
            console.error('Generate AI error:', err);
        } finally {
            setLoading(false);
        }
    };

    const handleSave = async () => {
        if (editorRef.current) {
            const html = editorRef.current.getHtml();
            const css = editorRef.current.getCss();
            const js = editorRef.current.getJs();
            const fullContent = `<style>${css}</style>${html}<script>${js}</script>`;
            try {
                setLoading(true);
                await api.post('/api/pages/save', { html: fullContent });
                navigate('/dashboard');
            } catch (err) {
                setError('Lỗi khi lưu: ' + (err.response?.data?.error || err.message));
                console.error('Save error:', err);
            } finally {
                setLoading(false);
            }
        }
    };

    useEffect(() => {
        const editor = GrapesJS.init({
            container: '#gjs-editor',
            fromElement: true,
            height: '500px',
            width: '100%',
            plugins: ['gjs-preset-webpage'],
            storageManager: false,
            assetManager: { upload: false },
        });

        editorRef.current = editor;

        return () => {
            editor.destroy();
        };
    }, []);

    return (
        <div className="create-landing-container">
            {loading && <div className="loading">Đang tạo...</div>}
            {error && (
                <div className="error">
                    {error}
                    <button onClick={() => setError(null)}>Đóng</button>
                </div>
            )}
            <h1>Tạo Landing Page Mới</h1>
            <div className="editor-preview">
                <div className="editor-section">
                    <h2>Giao diện kéo thả (GrapesJS)</h2>
                    <div id="gjs-editor" style={{ height: '500px', border: '1px solid #ccc' }}></div>
                </div>
                <div className="preview-section">
                    <h2>Preview từ AI</h2>
                    <iframe srcDoc={aiGeneratedContent} style={{ width: '100%', height: '500px', border: '1px solid #ccc' }} />
                </div>
            </div>
            <div className="description-section">
        <textarea
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            placeholder="Nhập mô tả (ví dụ: Trang bán căn hộ Quận 7, màu xanh, có form liên hệ)"
            rows="4"
            className="description-input"
        />
                <div className="actions">
                    <button onClick={handleGenerateAI} className="generate-btn">Tạo từ AI</button>
                    <button onClick={handleSave} className="save-btn">Lưu Landing Page</button>
                </div>
            </div>
        </div>
    );
};

export default CreateLanding;
